Wild Asia Island Magic

Nature Documentary hosted by Jeffrey Thomas, published by Discovery Channel in 2009 - English narration


Information
------------------------------

Asia is the continent of islands: at its southern limit alone there are some 30,000 islands dashed across the watery surface of the world. On these islands, freed from the certainties of continental life and powered by the magic of islands, species multiply and diversify. The central characters of Island Magic are the leopard, a top predator; the monitor lizard, an opportunistic scavenger which could become a top predator; and the ubiquitous fig tree.

